import Language from "./Language";
import { data } from "../data/data";

function Card() {
  // console.log(data);
  return (
    <div className="card">
      <h1>Language</h1>
      <div className="langWrapper">
        {data.map((language) => (
          <Language 
            key={language.name}
            name={language.name}
            img={language.img} 
            options={language.options}
          />
        ))}
      </div>
    </div>
  );
}
export default Card;
